v1Message.description:
*Message:** As a company admin, I want to create a promotional message for specific users,
so that I can send them promotional notifications.

Message service will store the messages that needs to be send to the customer. Message is
made of 3 things
- Template_Id (Template that needs to be send)
- query_Id (User who will receive this message)
- delivery_setting (When to start and stop sending the message)

```proto
message Message {
string id = 1; // parent will be company
string template_id = 2;
string query_id = 3;
Channel channel = 4;
DeliverySetting delivery_setting = 5;
string title = 6;
string description = 7;
map<string, string> metadata = 8;
}

message DeliverySetting {
DeliveryType type = 1;
google.protobuf.date_time start_date = 2;
string timezone = 3;
string time = 4; // sending_time
google.protobuf.date_time stop_date = 5;
StopType stop_type = 6;
LimitType limit_type = 7;
int32 limit = 8;
Frequency frequency = 9;
}

enum LimitType {
UNKNOWN = 0;
MAX = 1;
NO_LIMIT = 2;
}

enum StopType {
UNKNOWN = 0;
NEVER = 1;
SPECIFIC_DATE = 2;
}

enum DeliveryType {
UNKNOWN = 0;
ONCE = 1;
RECURRING = 2;
AS_CRITERIA_MATCH = 3;
}

enum Frequency {
UNSET = 0;
DAILY = 1;
WEEKLY = 2;
MONTHLY = 3;
}

```

Methods:
- Create
- validation of template and query_id
- Update
- validation of template and query_id
- Delete
- List
- (parent + channel filter( channel is optional))

v1MessageCount.description:
*Message Count Service**: As a company admin, I want to see the users count who have received
the particular message, so that I can check the statics of the a particular message.

This service will store the count (no. of users who have received this message)

```proto
message MessageCount {
string id = 1; // parent will be company
string message_id = 2;
int64 user_count = 3;
google.protobuf.Timestamp first_activity = 4;
google.protobuf.Timestamp last_activity = 5;
}
```

Methods
- IncreaseMessageCount(message_id, user_count)
- It will add the user_count with saved count if entry already exists else will create new entry.
- ListMessageCount(parent_id)
- It will return all MessageCount saved against that parent.

v1EventData.description:
*Event Data**: As a company admin, I want to select the users who are matching with criteria, so that I can send them promotional emails.

This service will insert the data into the events table. It will be called from the background events/ scheduler.

```proto
message EventData {
string id = 1; // parent = company id
string event_name = 2;
string event_data = 3; (JsonB in database)
string user_id = 5;
google.protobuf.Timestamp created_on = 7;
}

message EventDataRequest {
proto.Message message = 1;
string event_name = 2;
string parent_id = 3;
string user_id = 4; // user_event_profile_id
google.protobuf.Timestamp created_on = 5;
}
```
Methods:
- InsertEvent(EventDataRequest)
- It will take EventDataRequest object as input and then it will create its own custom object (with relevant) fields for that event
and insert it into the db.
We will create those objects in the proto.

- InsertEvents()
- It will take the list of events and insert it into the database.

v1MessagingEvent.description:
As a company admin, I want to see the list of events, so that I can make analysis based on those events.

```proto
message Event {
string id = 1; // parent is company
string name = 2;
string display_name = 3;
DataType data_type = 4;
bool default = 5;
string type = 6; // event_type
string app_type_id = 7;
string user_property = 8;
}
```

*rpc GetEventList()**
- It will take the parent_id and will return all the default event list + events those are created under the parent.

*rpc CreateEvent()**
- It will create the non default events within the company and will have have check that the event name do not already exists in
- In same company
- In default list

v1UserEventProfile.description:
*User event profile**: As a product owner, I want to save the user event profile to a separate table, so that during messaging we do not need to process all the users.

User event profile store the user property (each customer) for sending . It will be used for storing the messaging information.

```proto
message UserEventProfile {
string id = 1; // parent is company
string user_id = 2;
string customer_id = 3;
string parent_id = 4;
string email = 5;
string phone = 6;
string first_name = 7;
string last_name = 8;
string push_notification_enabled = 9; // TODO: [push_notification_enabled] string type ?
}
```
- When a new customer is create it will fire the event and will create the entry into the UserEventProfile table.
- When the customer object is updated it will fire the event and will update the existing entry.
